import { Route, Router, Routes } from "react-router-dom";
import Ddd from "./ddd";


function Ccc(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/data" element={<Ddd/>}/>
                </Routes>
            </Router>
        </div>
    )
}
export default Ccc;
